def authors(author_ids):
    query_att = 'PC,ECC,CC'
    CC = 0
    ECC = 0
    PC = 0
    for author_id in author_ids:
        resp = requests.get(f'https://api.labs.cognitive.microsoft.com/academic/v1.0/evaluate?expr=Id={author_id}&attributes={query_att}&subscription-key={SUBSCRIPTION_KEY}')
        resp_json = json.loads(resp.text)
        if 'PC' in resp_json['entities'][0]:
            PC += int(resp_json['entities'][0]['PC'])
        if 'CC' in resp_json['entities'][0]:
            CC += resp_json['entities'][0]['CC']
        if 'ECC' in resp_json['entities'][0]:
            ECC += resp_json['entities'][0]['ECC']
    PC = PC/len(author_ids)
    CC = CC/len(author_ids)
    ECC = ECC/len(author_ids)
    return (PC, CC, ECC)


def get_attribute(line):
    paper_id = line.split(' ')[6]
    query_att = 'CC,DOI,AA.AuId,F.FN'
    resp = requests.get(f'https://api.labs.cognitive.microsoft.com/academic/v1.0/evaluate?expr=Id={paper_id}&attributes={query_att}&subscription-key={SUBSCRIPTION_KEY}')
    resp_json = json.loads(resp.text)
    
    if 'entities' not in resp_json or len(resp_json['entities']) == 0:
        return f'{line.strip()} DOI "/" fields [] CC 0 A_PC 0 A_CC 0 A_ECC 0\n'
        

    if 'DOI' in resp_json['entities'][0]:
        DOI = resp_json['entities'][0]['DOI']
    else:
        DOI = '/'

    if 'CC' in resp_json['entities'][0]:
        cit_count = resp_json['entities'][0]['CC']
    else:
        cit_count = '0'

    if 'F' in resp_json['entities'][0]:
        fields = [] 
        for f in resp_json['entities'][0]['F']:
            fields.append(f['FN'])
    else:
        fields = []

    if 'AA' in resp_json['entities'][0]:
        author_ids = [] 
        for a in resp_json['entities'][0]['AA']:
            author_ids.append(a['AuId'])
        A_PC, A_CC, A_ECC = authors(author_ids)
    else:
        A_PC, A_CC, A_ECC = 0, 0, 0

    line = f'{line.strip()} DOI "{DOI}" fields {fields} CC {cit_count} A_PC {A_PC} A_CC {A_CC} A_ECC {A_ECC}\n'
    return line


IN_FILE = './data/arxiv_network.net'
OUT_FILE = './data/arxiv_att_network.net'

out_file = open(OUT_FILE, 'w')
c = max(len(node_1), len(node_2))
with open(IN_FILE, 'r') as in_file:
    for line in in_file:
        if 'title' in line:
            paper_id = line.split(' ')[6]
            if paper_id in node_1 or paper_id in node_2:
                try:
                    node_1.remove(paper_id)
                    node_2.remove(paper_id)
                except:
                    pass
                line = get_attribute(line)
                c-=1
                print(c)
        out_file.write(line)

out_file.close()